import {useEffect, useState} from "react";
import TableHead from "./TableHead";
import Skeleton from "./Skeleton";


 
function Table() {
  
  const [spatable, setSpatable] = useState(false);
  useEffect(() => {
    getSpatable();
  }, []);
  function getSpatable() {
    fetch('http://localhost:3001')
      .then(response => {
        return response.text();
      })
      .then(data => {
        setSpatable(data);
        
      });
     
  }

   const data = [].slice.call(spatable);;
   console.log(data);
    return (
      
              <div className="Table">
                
  {spatable}
<table>
        <tr>
          <th>Date</th>
          <th>Name</th>
          <th>Quanity</th>
          <th>Distance</th>
        </tr>
        {data.map((val, key) => {
          return (
            <tr key={key}>
              <td>{val.date}</td>
              <td>{val.name}</td>
              <td>{val.quanity}</td>
              <td>{val.distance}</td>
            </tr>
          )
        })}
      </table>
    </div>
  );
}
  

export default Table;
